101Y00000X	101Y00000X	Behavioral Health & Social Service Providers	Counselor	\N	A provider who is trained and educated in the performance of behavior health services through interpersonal communications and analysis. Training and education at the specialty level usually requires a master’s degree and clinical experience and supervision for licensure or certification.	Sources: Abridged from definitions provided by the National Board of Certified Counselors and the American Association of Pastoral Counselors.	\N	\N	\N	metaTaxonomyCode:101Y00000X	\N	\N	\N	\N	\N	f
