103TP0016X	103TP0016X	Behavioral Health & Social Service Providers	Psychologist	Prescribing (Medical)	Those licensed psychologists who have completed specialized, post-doctoral training in psychopharmacology, passed a national proficiency examination in psychopharmacology, and who are authorized by state statute to prescribe medications, in accordance with their state law and state licensing authority, for the evaluation, diagnosis, management and treatment of mental, nervous, emotional, behavioral, and related disorders.	Source:  Louisiana Academy of Medical Psychologists Note:  Some states issue licenses under Medical Psychologist. [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:103TP0016X	\N	\N	\N	\N	\N	f
103TP0814X	103TP0814X	Behavioral Health & Social Service Providers	Psychologist	Psychoanalysis	(1) A practitioner of psychoanalysis: methods of eliciting from patients their past emotional experiences and their role in influencing their current mental life, in order to discover the conflicts and mechanisms by which their pathologic mental state has been produced and to furnish hints for psychotherapeutic procedures, the method employs free association, recall and interpretation of dreams and interpretation of transference and resistance phenomena; (2) An individual who is educated with a doctor’s degree in psychoanalysis or psychology, trained at an established psychoanalytic institute, and practices or adheres to the principles of psychoanalysis. Psychoanalysis is a form of psychotherapy and a system of investigation for determining and understanding mental processes, which was originally conceived by Sigmund Freud. Psychoanalysis involves the analysis and interpretation of dreams, resistances, and transferences, and uses free association and catharsis. Clinical practice requires licensure.	Sources: (1) Dorlands Illustrated Medical Dictionary, 28th Edition, W.B. Saunders Company: Philadelphia, 1994, p. 1382; (2)American Psychological Association, Washington, DC, 1997, and Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:103TP0814X	\N	\N	\N	\N	\N	f
