104100000X	104100000X	Behavioral Health & Social Service Providers	Social Worker	\N	A social worker is a person who is qualified by a Social Work degree, and licensed, certified or registered by the state as a social worker to practice within the scope of that license.  A social worker provides assistance and counseling to clients and their families who are dealing with social, emotional and environmental problems. Social work services may be rendered to individuals, families, groups, and the public.	Source: National Association of Social Workers, 2009 [7/1/2009: definition modified]	\N	\N	\N	metaTaxonomyCode:104100000X	\N	\N	\N	\N	\N	f
1223D0001X	1223D0001X	Dental Providers	Dentist	Dental Public Health	The science and art of preventing and controlling dental diseases and promoting dental health through organized community efforts.  It is that form of dental practice that serves the community as a patient rather than the individual.  It is concerned with the dental health education of the public, with applied dental research, and with the administration of group dental care programs as well as the prevention and control of dental diseases on a community basis.	Source: Council on Dental Education and Licensure, American Dental Association	\N	\N	\N	metaTaxonomyCode:1223D0001X	\N	\N	\N	\N	\N	f
