136A00000X	136A00000X	Dietary & Nutritional Service Providers	Dietetic Technician, Registered	\N	A person trained in food and nutrition who is an integral part of health care and foodservice management teams. A dietetic technician, registered (DTR) has successfully completed at least a two-year associate’s degree at a US regionally accredited college or university; a dietetic technician program approved by The American Dietetic Association, including 450 hours of supervised practice experience; a national examination administered by the Commission on Dietetic Registration; and continuing professional educational requirements to maintain registration.	Source: The American Dietetic Association. Becoming a Dietetic Technician, Registered -- a food and nutrition practitioner. Chicago, IL: The American dietetic association, July 1997.	\N	\N	\N	metaTaxonomyCode:136A00000X	\N	\N	\N	\N	\N	f
146L00000X	146L00000X	Emergency Medical Service Providers	Emergency Medical Technician, Paramedic	\N	An EMT, Paramedic is an individual trained and certified to perform advanced life support (ALS) in medical emergencies based on individual state boards.	Sources: Tabers Medical Dictionary and Florida EMS Clearing House.	\N	\N	\N	metaTaxonomyCode:146L00000X	\N	\N	\N	\N	\N	f
146M00000X	146M00000X	Emergency Medical Service Providers	Emergency Medical Technician, Intermediate	\N	An Intermediate EMT is an individual trained and certified to perform intermediate life support treatment in medical emergencies based on individual state boards.	Sources: Tabers Medical Dictionary and Florida EMS Clearing House.	\N	\N	\N	metaTaxonomyCode:146M00000X	\N	\N	\N	\N	\N	f
146N00000X	146N00000X	Emergency Medical Service Providers	Emergency Medical Technician, Basic	\N	A Basic EMT is an individual trained and certified to perform basic life support treatment in medical emergencies based on individual state boards.	Sources: Tabers Medical Dictionary and Florida EMS Clearing House.	\N	\N	\N	metaTaxonomyCode:146N00000X	\N	\N	\N	\N	\N	f
152W00000X	152W00000X	Eye and Vision Services Providers	Optometrist	\N	Doctors of optometry (ODs) are the primary health care professionals for the eye.  Optometrists examine, diagnose, treat, and manage diseases, injuries, and disorders of the visual system, the eye, and associated structures as well as identify related systemic conditions affecting the eye.  An optometrist has completed pre-professional undergraduate education in a college or university and four years of professional education at a college of optometry, leading to the doctor of optometry (O.D.) degree.  Some optometrists complete an optional residency in a specific area of practice.  Optometrists are eye health care professionals state-licensed to diagnose and treat diseases and disorders of the eye and visual system. 	Source:  American Optometric Association (AOA), approved by the AOA’s Board of Trustees, June 21, 2005. [7/1/2006: definition modified]	\N	\N	\N	metaTaxonomyCode:152W00000X	\N	\N	\N	\N	\N	f
152WC0802X	152WC0802X	Eye and Vision Services Providers	Optometrist	Corneal and Contact Management	The professional activities performed by an Optometrist related to the fitting of contact lenses to an eye, ongoing evaluation of the cornea’s ability to sustain successful contact lens wear, and treatment of any external eye or corneal condition which can affect contact lens wear.	Source: American Optometric Association [1/1/2009: added definition, added source]	\N	\N	\N	metaTaxonomyCode:152WC0802X	\N	\N	\N	\N	\N	f
