170100000X	170100000X	Other Service Providers	Medical Genetics, Ph.D. Medical Genetics	\N	A medical geneticist works in association with a medical specialist, is affiliated with a clinical genetics program, and serves as a consultant to medical and dental specialists. 	A general certificate was first issued by ABMS in 1982.  ACGME Accredited Residency Program Requirements:  None.	\N	\N	\N	metaTaxonomyCode:170100000X	\N	\N	\N	\N	\N	f
170300000X	170300000X	Other Service Providers	Genetic Counselor, MS	\N	A masters trained health care provider who collects and interprets genetic family histories; assesses the risk of disease occurrence or recurrence; identifies interventions to manage or ameliorate disease risk; educates about inheritance, testing, management, prevention, ethical issues, resources, and research; and counsels to promote informed choices and adaptation. Certification was established in 1993 by the American Board of Genetic Counseling and prior to that by the American Board of Medical Genetics. Requirements for experience, licensure, and job responsibilities vary among the states.	Source: National Society of Genetic Counselors [7/1/2005: new]	\N	\N	\N	metaTaxonomyCode:170300000X	\N	\N	\N	\N	\N	f
