1710I1002X	1710I1002X	Other Service Providers	Military Health Care Provider	Independent Duty Corpsman	A Navy Independent Duty Corpsman (IDC) is an active duty Sailor who has successfully completed one of the Navy's specific IDC training programs.  IDCs are formally trained and educated to perform primary medical care and minor surgical services in a variety of health care and non-health care settings worldwide under indirect physician supervision.  IDCs provide care to Department of Defense operational forces and other supporting forces such as contractors and foreign nationals.	Source:  Bureau of Medicine and Surgery, Department of the Navy  [7/1/2005: new]	\N	\N	\N	metaTaxonomyCode:1710I1002X	\N	\N	\N	\N	\N	f
1710I1003X	1710I1003X	Other Service Providers	Military Health Care Provider	Independent Duty Medical Technicians	An Independent Duty Medical Technician (IDMT) is specially trained and educated to perform primary medical care, minor surgical services, and treatment of dental disorders for active duty military members in a variety of health care and non-health care settings worldwide under direct and indirect physician supervision.  An IDMT may take medical histories, perform physical exams, order lab tests and x-rays, prescribe medications, and give immunizations. IDMTs work under the direct supervision of a physician preceptor when at home station and indirectly when assigned to a Mobile Aid Station, Mobile Medical Unit, remote site, or otherwise deployed specifically as an IDMT.  An IDMT may be an experienced Aerospace Medical Service Technician who meets special task qualifications and is recommended for training by the Aerospace Medical Service Functional Manager at their Medical Treatment Facility.  IDMTs maintain certification as Nationally Registered Emergency Medical Technicians and as Immunization Back-up Technicians.	Source:  Air Force Surgeon General Office  [7/1/2005: new]	\N	\N	\N	metaTaxonomyCode:1710I1003X	\N	\N	\N	\N	\N	f
171100000X	171100000X	Other Service Providers	Acupuncturist	\N	An acupuncturist is a person who performs ancient therapy for alleviation of pain, anesthesia and treatment of some diseases. Acupuncturists use long, fine needles inserted into specific points in order to treat painful conditions or produce anesthesia.	\N	\N	\N	\N	metaTaxonomyCode:171100000X	\N	\N	\N	\N	\N	f
