172M00000X	172M00000X	Other Service Providers	Mechanotherapist	\N	A practitioner of mechanotherapy examines patients by verbal inquiry, examination of the musculoskeletal system by hand, and visual inspection and observation.  In the treatment of patients, mechanotherapists employ the techniques of advised or supervised exercise; electrical neuromuscular stimulation; massage or manipulation; or air, water, heat, cold, sound, or infrared ray therapy.	Source:  Summarized from Ohio Revised Code 4731.15 [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:172M00000X	\N	\N	\N	\N	\N	f
172P00000X	172P00000X	Other Service Providers	Naprapath	\N	Naprapathy means a branch of medicine that focuses on the evaluation and treatment of neuron-muscular conditions.  Doctors of naprapathy are connective tissue specialists.  Education and training are defined through individual states’ licensing/certification requirements.	Source:  National Uniform Claim Committee [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:172P00000X	\N	\N	\N	\N	\N	f
172V00000X	172V00000X	Other Service Providers	Community Health Worker	\N	Community health workers (CHW) are lay members of communities who work either for pay or as volunteers in association with the local health care system in both urban and rural environments and usually share ethnicity, language, socioeconomic status and life experiences with the community members they serve. They have been identified by many titles such as community health advisors, lay health advocates, "promotores(as), outreach educators, community health representatives, peer health promoters, and peer health educators. CHWs offer interpretation and translation services, provide culturally appropriate health education and information, assist people in receiving the care they need, give informal counseling and guidance on health behaviors, advocate for individual and community health needs, and provide some direct services such as first aid and blood pressure screening.  Some examples of these practitioners are Community Health Aides or Practitioners established under 25 USC §1616 (l) under HHS, Indian Health Service, Public Health Service.	Source: Health Resources and Services Administration, US Department of Health and Human Services – National Workforce Study on Community Health Workers, March, 2007. [7/1/2007: new]    http://bhpr.hrsa.gov/healthworkforce/chw/	\N	\N	\N	metaTaxonomyCode:172V00000X	\N	\N	\N	\N	\N	f
173000000X	173000000X	Other Service Providers	Legal Medicine	\N	The specialty areas of medicine concerned with matters of, and relations with, substantive law and legal institutions; such as the conduct of medical examinations at crime scenes, performance of autopsies, giving of expert medical testimony in judicial proceedings, medical treatment of inmates of penal institutions, the practice of trauma medicine in law enforcement settings, and other clinical practice and medical science applications in the fields of law, law enforcement, and corrections.	Source: Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:173000000X	\N	\N	\N	\N	\N	f
173C00000X	173C00000X	Other Service Providers	Reflexologist	\N	Reflexologists perform a non-invasive complementary modality involving thumb and finger techniques to apply alternating pressure to the reflexes within the reflex maps of the body located on the feet, hands, and outer ears. Reflexologists apply pressure to specific areas (feet, hands, and ears) to promote a response from an area far removed from the tissue stimulated via the nervous system and acupuncture meridians. Reflexologists are recommended to complete a minimum of 200 hours of education, typically including anatomy & physiology, Reflexology theory, body systems, zones, meridians & relaxation response, ethics, business standards, and supervised practicum.	Source: National Uniform Claim Committee (based on the American Reflexology Certification Board definition of Reflexology), 2007  [1/1/2008: new]    Additional Resources:  Foot and hand reflexology is a scientific art based on the premise that there are zones and reflex areas in the feet and hands which correspond to all body parts. The physical act of applying specific pressures using thumb, finger and hand techniques result in stress reduction which causes a physiological change in the body. Reflexology is a non-invasive, complementary modality involving thumb and finger techniques to apply alternating pressure to reflexes shown on reflex maps of the body located on the feet, hands, and outer ears.  American Reflexology Certification Board, www.arcb.net/definiti.htm; Reflexology Association of America, www.reflexology-usa.org/standards.html	\N	\N	\N	metaTaxonomyCode:173C00000X	\N	\N	\N	\N	\N	f
