173F00000X	173F00000X	Other Service Providers	Sleep Specialist, PhD	\N	Sleep medicine is a clinical specialty with a focus on clinical problems that require accurate diagnosis and treatment. The knowledge base of sleep medicine is derived from many disciplines including neuroanatomy, neurophysiology, respiratory physiology, pharmacology, psychology, psychiatry, neurology, general internal medicine, pulmonary medicine, and pediatrics as well as others.	Source: National Uniform Claim Committee (based on American Board of Sleep Medicine), 2007 [1/1/2008: new]    Additional resources: www.absm.org	\N	\N	\N	metaTaxonomyCode:173F00000X	\N	\N	\N	\N	\N	f
