174H00000X	174H00000X	Other Service Providers	Health Educator	\N	Health educators work in a variety of settings providing education to individuals or groups of individuals on healthy behaviors, wellness, and health-related topics with the goal of preventing diseases and health problems.  Health educators generally require a bachelor’s degree and may receive additional training, such as through mentoring, internships, or volunteer work.	Source:  National Uniform Claim Committee, 2009 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:174H00000X	\N	\N	\N	\N	\N	f
