207RH0002X	207RH0002X	Allopathic & Osteopathic Physicians	Internal Medicine	Hospice and Palliative Medicine	An internal medicine physician with special knowledge and skills to prevent and relieve the suffering experienced by patients with life-limiting illnesses. This specialist works with an interdisciplinary hospice or palliative care team to maximize quality of life while addressing physical, psychological, social and spiritual needs of both patient and family throughout the course of the disease, through the dying process, and beyond for the family.  This specialist has expertise in the assessment of patients with advanced disease; the relief of distressing symptoms; the coordination of interdisciplinary patient and family-centered care in diverse venues; the use of specialized care systems including hospice; the management of the imminently dying patient; and legal and ethical decision making in end-of-life care.	Source: American Academy of Hospice and Palliative Medicine [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:207RH0002X	\N	\N	\N	\N	\N	f
207RH0003X	207RH0003X	Allopathic & Osteopathic Physicians	Internal Medicine	Hematology & Oncology	An internist doctor of osteopathy that specializes in the treatment of the combination of hematology and oncology disorders.  A doctor of osteopathy that is board eligible/certified by the American Osteopathic Board of Internal Medicine WAS able to obtain a Certificate of Special Qualifications in the field of Hematology and Oncology.  The Certificate is NO longer offered.	Source: American Osteopathic Board of Internal Medicine, 2007.  [7/1/2008: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: http://www.osteopathic.org/certification	\N	\N	\N	metaTaxonomyCode:207RH0003X	\N	\N	\N	\N	\N	f
207RH0005X	207RH0005X	Allopathic & Osteopathic Physicians	Internal Medicine	Hypertension Specialist	A Hypertension Specialist is a physician who concentrates on all aspects of the diagnosis and treatment of hypertension.	Source:  American Society of Hypertension [7/1/2011: new]  Additional Resources:  The American Society of Hypertension Specialists Program offers an examination and designation for Hypertension Specialists.  This subspecialty is not a Board certificate issued by either the American Board of Internal Medicine or the American Osteopathic Board of Internal Medicine.	\N	\N	\N	metaTaxonomyCode:207RH0005X	\N	\N	\N	\N	\N	f
