207RI0008X	207RI0008X	Allopathic & Osteopathic Physicians	Internal Medicine	Hepatology	The discipline of Hepatology encompasses the structure, function, and diseases of the liver and biliary tract. The American Board of Internal Medicine considers Hepatology part of the subspecialty of gastroenterology. Physicians who identify themselves as Hepatologists usually, but not always, have been trained in gastrointestinal programs.	Training Programs, and/or Fellowships, Preceptorships: The American Association for the Study of Liver Diseases (AASLD) is the major professional society organized for physicians with an interest in Hepatology. A subcommittee of that organization has published guidelines for training programs in the 1992 November issue of Hepatology. Source: The American Board of Internal Medicine 9/1993    ACGME Accredited Residency Program Requirements:  None 	\N	\N	\N	metaTaxonomyCode:207RI0008X	\N	\N	\N	\N	\N	f
207RI0011X	207RI0011X	Allopathic & Osteopathic Physicians	Internal Medicine	Interventional Cardiology	An area of medicine within the subspecialty of cardiology, which uses specialized imaging and other diagnostic techniques to evaluate blood flow and pressure in the coronary arteries and chambers of the heart and uses technical procedures and medications to treat abnormalities that impair the function of the cardiovascular system.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source]   Additional Resources: American Board of Internal Medicine, 2007. http://www.abim.org/    Board Certification for Medical Doctors (MDs) is provided by the American Board of Internal Medicine.  ACGME Accredited Residency Program Requirements:  1 year of training plus a prerequisite of 3 years Internal Medicine, 3 years Cardiovascular Disease for a total of 7 years.  ABMS Approved Subspecialty Certificate  (Internal Medicine)	\N	\N	\N	metaTaxonomyCode:207RI0011X	\N	\N	\N	\N	\N	f
207RI0200X	207RI0200X	Allopathic & Osteopathic Physicians	Internal Medicine	Infectious Disease	An internist who deals with infectious diseases of all types and in all organ systems. Conditions requiring selective use of antibiotics call for this special skill. This physician often diagnoses and treats AIDS patients and patients with fevers which have not been explained. Infectious disease specialists may also have expertise in preventive medicine and travel medicine.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Internal Medicine, 2007.  http://www.abim.org/.  American Osteopathic Board of Internal Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Internal  Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Internal  Medicine.	\N	\N	\N	metaTaxonomyCode:207RI0200X	\N	\N	\N	\N	\N	f
