207V00000X	207V00000X	Allopathic & Osteopathic Physicians	Obstetrics & Gynecology	\N	An obstetrician/gynecologist possesses special knowledge, skills and professional capability in the medical and surgical care of the female reproductive system and associated disorders. This physician serves as a consultant to other physicians and as a primary physician for women.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Obstetrics and Gynecology, 2007.  http://www.abog.org/.  American Osteopathic Board of Obstetrics and Gynecology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Obstetrics and Gynecology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Obstetrics and Gynecology.	\N	\N	\N	metaTaxonomyCode:207V00000X	\N	\N	\N	\N	\N	f
207VB0002X	207VB0002X	Allopathic & Osteopathic Physicians	Obstetrics & Gynecology	Obesity Medicine	A physician who specializes in the treatment of obesity demonstrates competency in and a thorough understanding of the treatment of obesity and the genetic, biologic, environmental, social, and behavioral factors that contribute to obesity. The obesity medicine physician employs therapeutic interventions including diet, physical activity, behavioral change, and pharmacotherapy. The obesity medicine physician utilizes a comprehensive approach, and may include additional resources such as dietitians, exercise physiologists, mental health professionals and bariatric surgeons as indicated to achieve optimal results. Additionally, the obesity medicine physician maintains competency in providing pre- peri- and post-surgical care of bariatric surgery patients, promotes the prevention of obesity, and advocates for those who suffer from obesity.	Source:  American Board of Obesity Medicine [7/1/2015: title and definition modified]  Additional Resource: American Society of Bariatric Physicians, www.asbp.org.	\N	\N	\N	metaTaxonomyCode:207VB0002X	\N	\N	\N	\N	\N	f
207VC0200X	207VC0200X	Allopathic & Osteopathic Physicians	Obstetrics & Gynecology	Critical Care Medicine	An obstetrician/gynecologist, who specializes in critical care medicine diagnoses, treats and supports female patients with multiple organ dysfunction. This specialist may have administrative responsibilities for intensive care units and may also facilitate and coordinate patient care among the primary physician, the critical care staff and other specialists.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Obstetrics and Gynecology, 2007.  http://www.abog.org/.  American Osteopathic Board of Obstetrics and Gynecology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Obstetrics and Gynecology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Obstetrics and Gynecology.	\N	\N	\N	metaTaxonomyCode:207VC0200X	\N	\N	\N	\N	\N	f
207VE0102X	207VE0102X	Allopathic & Osteopathic Physicians	Obstetrics & Gynecology	Reproductive Endocrinology	An obstetrician/gynecologist who is capable of managing complex problems relating to reproductive endocrinology and infertility.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Obstetrics and Gynecology, 2007.  http://www.abog.org/.  American Osteopathic Board of Obstetrics and Gynecology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Obstetrics and Gynecology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Obstetrics and Gynecology.	\N	\N	\N	metaTaxonomyCode:207VE0102X	\N	\N	\N	\N	\N	f
207VF0040X	207VF0040X	Allopathic & Osteopathic Physicians	Obstetrics & Gynecology	Female Pelvic Medicine and Reconstructive Surgery	A subspecialist in Female Pelvic Medicine and Reconstructive Surgery is a physician in Urology or Obstetrics and Gynecology who, by virtue of education and training, is prepared to provide consultation and comprehensive management of women with complex benign pelvic conditions, lower urinary tract disorders, and pelvic floor dysfunction. Comprehensive management includes those diagnostic and therapeutic procedures necessary for the total care of the patient with these conditions and complications resulting from them.	Source: American Board of Medical Specialties, 2011. [1/1/2012: new]  Resources:  www.abms.org	\N	\N	\N	metaTaxonomyCode:207VF0040X	\N	\N	\N	\N	\N	f
