207ZP0102X	207ZP0102X	Allopathic & Osteopathic Physicians	Pathology	Anatomic Pathology & Clinical Pathology	A pathologist deals with the causes and nature of disease and contributes to diagnosis, prognosis and treatment through knowledge gained by the laboratory application of the biologic, chemical and physical sciences. A pathologist uses information gathered from the microscopic examination of tissue specimens, cells and body fluids, and from clinical laboratory tests on body fluids and secretions for the diagnosis, exclusion and monitoring of disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added, 7/1/2009: definition reformatted]    Additional Resources: American Board of Pathology, 2007. http://www.abpath.org/    This taxonomy code identifies the combined anatomic pathology & clinical pathology route. Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology. To acknowledge the diverse activities in the practice of pathology and to accommodate the interests of individuals wanting to enter the field, the ABP offers primary certification through the following three routes: combined anatomic pathology and clinical pathology, anatomic pathology only and clinical pathology only. Primary certification in anatomic pathology or clinical pathology may be combined with some of the subspecialty certifications.	\N	\N	\N	metaTaxonomyCode:207ZP0102X	\N	\N	\N	\N	\N	f
207ZP0104X	207ZP0104X	Allopathic & Osteopathic Physicians	Pathology	Chemical Pathology	A chemical pathologist has expertise in the biochemistry of the human body as it applies to the understanding of the cause and progress of disease. This physician functions as a clinical consultant in the diagnosis and treatment of human disease. Chemical pathology entails the application of biochemical data to the detection, confirmation or monitoring of disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZP0104X	\N	\N	\N	\N	\N	f
