207ZP0213X	207ZP0213X	Allopathic & Osteopathic Physicians	Pathology	Pediatric Pathology	A pediatric pathologist is expert in the laboratory diagnosis of diseases that occur during fetal growth, infancy and child development. The practice requires a strong foundation in general pathology and substantial understanding of normal growth and development, along with extensive knowledge of pediatric medicine.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.	\N	\N	\N	metaTaxonomyCode:207ZP0213X	\N	\N	\N	\N	\N	f
208000000X	208000000X	Allopathic & Osteopathic Physicians	Pediatrics	\N	A pediatrician is concerned with the physical, emotional and social health of children from birth to young adulthood. Care encompasses a broad spectrum of health services ranging from preventive healthcare to the diagnosis and treatment of acute and chronic diseases. A pediatrician deals with biological, social and environmental influences on the developing child, and with the impact of disease and dysfunction on development.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certificatio<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:208000000X	\N	\N	\N	\N	\N	f
2080P0216X	2080P0216X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Rheumatology	A pediatrician who treats diseases of joints, muscle, bones and tendons. A pediatric rheumatologist diagnoses and treats arthritis, back pain, muscle strains, common athletic injuries and "collagen" diseases.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080P0216X	\N	\N	\N	\N	\N	f
