2080N0001X	2080N0001X	Allopathic & Osteopathic Physicians	Pediatrics	Neonatal-Perinatal Medicine	A pediatrician who is the principal care provider for sick newborn infants. Clinical expertise is used for direct patient care and for consulting with obstetrical colleagues to plan for the care of mothers who have high-risk pregnancies.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080N0001X	\N	\N	\N	\N	\N	f
2080P0006X	2080P0006X	Allopathic & Osteopathic Physicians	Pediatrics	Developmental – Behavioral Pediatrics	A developmental-behavioral specialist is a pediatrician with special training and experience who aims to foster understanding and promotion of optimal development of children and families through research, education, clinical care and advocacy efforts. This physician assists in the prevention, diagnosis, and management of developmental difficulties and problematic behaviors in children and in the family dysfunctions that compromise children's development.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source changed, 3/26/2008: definition corrected]    Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080P0006X	\N	\N	\N	\N	\N	f
2080P0008X	2080P0008X	Allopathic & Osteopathic Physicians	Pediatrics	Neurodevelopmental Disabilities	A pediatrician who treats children having developmental delays or learning disorders including those associated with visual and hearing impairment, mental retardation, cerebral palsy, spina bifida, autism and other chronic neurologic conditions. This specialist provides medical consultation and education and assumes leadership in the interdisciplinary management of children with neurodevelopmental disorders. They may also focus on the early identification and diagnosis of neurodevelopmental disabilities in infants and young children as well as on changes that occur as the child with developmental disabilities grows.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source changed]    Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080P0008X	\N	\N	\N	\N	\N	f
2080P0201X	2080P0201X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Allergy/Immunology	A pediatrician who specializes in the diagnosis and treatment of allergies, allergic reactions, and immunologic diseases in children.	Source: National Uniform Claim Committee, 2009 [1/1/2010: title modified, definition added, source added]    Additional Resources: A Certification of Special Qualifications (CSQ) is issued by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080P0201X	\N	\N	\N	\N	\N	f
2080P0202X	2080P0202X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Cardiology	A pediatric cardiologist provides comprehensive care to patients with cardiovascular problems. This specialist is skilled in selecting, performing and evaluating the structural and functional assessment of the heart and blood vessels, and the clinical evaluation of cardiovascular disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pediatrics.  The Certification is no longer offered.	\N	\N	\N	metaTaxonomyCode:2080P0202X	\N	\N	\N	\N	\N	f
