2083P0901X	2083P0901X	Allopathic & Osteopathic Physicians	Preventive Medicine	Public Health & General Preventive Medicine	Public health and general preventive medicine focuses on promoting health, preventing disease, and managing the health of communities and defined populations. These practitioners combine population-based public health skills with knowledge of primary, secondary, and tertiary prevention-oriented clinical practice in a wide variety of settings.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.  American Osteopathic Board of Preventive Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083P0901X	\N	\N	\N	\N	\N	f
