2083T0002X	2083T0002X	Allopathic & Osteopathic Physicians	Preventive Medicine	Medical Toxicology	Medical toxicologists are physicians who specialize in the prevention, evaluation, treatment and monitoring of injury and illness from exposures to drugs and chemicals, as well as biological and radiological agents. Medical toxicologists care for people in clinical, academic, governmental and public health settings, and provide poison control center leadership. Important areas of medical toxicology include acute drug poisoning, adverse drug events, drug abuse, addiction and withdrawal, chemicals and hazardous materials, terrorism preparedness, venomous bites and stings, and environmental and workplace exposures.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083T0002X	\N	\N	\N	\N	\N	f
2083X0100X	2083X0100X	Allopathic & Osteopathic Physicians	Preventive Medicine	Occupational Medicine	Occupational medicine focuses on the health of workers, including the ability to perform work; the physical, chemical, biological, and social environments of the workplace; and the health outcomes of environmental exposures. Practitioners in this field address the promotion of health in the work place, and the prevention and management of occupational and environmental injury, illness, and disability.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083X0100X	\N	\N	\N	\N	\N	f
2084A0401X	2084A0401X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Addiction Medicine	A doctor of osteopathy board eligible/certified in the field of Psychiatry by the American Osteopathic Board of Neurology and Psychiatry is able to obtain a Certificate of Added Qualifications in the field of Addiction Medicine	Source: American Osteopathic Board of Neurology and Psychiatry, 2007 [1/1/2008: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: http://www.osteopathic.org/certification	\N	\N	\N	metaTaxonomyCode:2084A0401X	\N	\N	\N	\N	\N	f
2084A2900X	2084A2900X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neurocritical Care	The medical subspecialty of Neurocritical Care is devoted to the comprehensive, multisystem care of the critically-ill neurological patient. Like other intensivists, the neurointensivist generally assumes the primary role for coordinating the care of his or her patients in the ICU, both the neurological and medical management of the patient.  They may also provide consultative services for these patients as requested within the health system.	Source: Adapted from the United Council for Neurologic Subspecialties website definition at: http://www.ucns.org/go/subspecialty/neurocritical [7/1/2016: new]	\N	\N	\N	metaTaxonomyCode:2084A2900X	\N	\N	\N	\N	\N	f
2084B0002X	2084B0002X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Obesity Medicine	A physician who specializes in the treatment of obesity demonstrates competency in and a thorough understanding of the treatment of obesity and the genetic, biologic, environmental, social, and behavioral factors that contribute to obesity. The obesity medicine physician employs therapeutic interventions including diet, physical activity, behavioral change, and pharmacotherapy. The obesity medicine physician utilizes a comprehensive approach, and may include additional resources such as dietitians, exercise physiologists, mental health professionals and bariatric surgeons as indicated to achieve optimal results. Additionally, the obesity medicine physician maintains competency in providing pre- peri- and post-surgical care of bariatric surgery patients, promotes the prevention of obesity, and advocates for those who suffer from obesity.	Source:  American Board of Obesity Medicine [7/1/2015: title and definition modified]  Additional Resource: American Society of Bariatric Physicians, www.asbp.org.	\N	\N	\N	metaTaxonomyCode:2084B0002X	\N	\N	\N	\N	\N	f
2084B0040X	2084B0040X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Behavioral Neurology & Neuropsychiatry	Behavioral Neurology & Neuropsychiatry is a medical subspecialty involving the diagnosis and treatment of neurologically based behavioral issues.	Source: National Uniform Claim Committee. [1/1/2012: new]  Additional Resources:  American Academy of Neurology, www.aan.com.	\N	\N	\N	metaTaxonomyCode:2084B0040X	\N	\N	\N	\N	\N	f
2084D0003X	2084D0003X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Diagnostic Neuroimaging	A licensed physician, who has completed a residency program in Neurology, and who has additional training, experience, and competence in the standards of performance and interpretation of Magnetic Resonance Imaging (MRI / MRA) of the head, spine, and peripheral nerves, and Computed Tomography (CT) of the head and spine. Physicians are trained in the administration of contrast media and the recognition and treatment of adverse reactions to contrast media. Neuroimaging training encompasses thorough knowledge of clinical neurology, neurophysiology, neuroanatomy, neurochemistry, neuropharmacology, and dynamics of cerebrospinal fluid circulation.  Physicians possess special expertise in the technical aspects and clinical applications of each of the modalities and techniques of neuroimaging.	Source:  American Academy of Neurology [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2084D0003X	\N	\N	\N	\N	\N	f
2084F0202X	2084F0202X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Forensic Psychiatry	Forensic Psychiatry is a subspecialty with psychiatric focus on interrelationships with civil, criminal and administrative law, evaluation and specialized treatment of individuals involved with the legal system, incarcerated in jails, prisons, and forensic psychiatry hospitals.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084F0202X	\N	\N	\N	\N	\N	f
2084H0002X	2084H0002X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Hospice and Palliative Medicine	A psychiatrist or neurologist with special knowledge and skills to prevent and relieve the suffering experienced by patients with life-limiting illnesses. This specialist works with an interdisciplinary hospice or palliative care team to maximize quality of life while addressing physical, psychological, social and spiritual needs of both patient and family throughout the course of the disease, through the dying process, and beyond for the family.  This specialist has expertise in the assessment of patients with advanced disease; the relief of distressing symptoms; the coordination of interdisciplinary patient and family-centered care in diverse venues; the use of specialized care systems including hospice; the management of the imminently dying patient; and legal and ethical decision making in end-of-life care.	Source: American Academy of Hospice and Palliative Medicine [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2084H0002X	\N	\N	\N	\N	\N	f
2084N0008X	2084N0008X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neuromuscular Medicine	A neurologist or child neurologist who specializes in the diagnosis and management of disorders of nerve, muscle or neuromuscular junction, including amyotrophic lateral sclerosis, peripheral neuropathies (e.g., diabetic and immune mediated neuropathies), various muscular dystrophies, congenital and acquired myopathies, inflammatory myopathies (e.g., polymyositis, inclusion body myositis) and neuromuscular transmission disorders (e.g., myasthenia gravis, Lambert-Eaton myasthenic syndrome).	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: new]    Additional Resources: American Board of Psychiatry and Neurology, 2007.  http://www.abpn.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Psychiatry and Neurology	\N	\N	\N	metaTaxonomyCode:2084N0008X	\N	\N	\N	\N	\N	f
2084N0400X	2084N0400X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neurology	A Neurologist specializes in the diagnosis and treatment of diseases or impaired function of the brain, spinal cord, peripheral nerves, muscles, autonomic nervous system, and blood vessels that relate to these structures.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084N0400X	\N	\N	\N	\N	\N	f
2084P0005X	2084P0005X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neurodevelopmental Disabilities	A pediatrician or neurologist who specializes in the diagnosis and management of chronic conditions that affect the developing and mature nervous system such as cerebral palsy, mental retardation and chronic behavioral syndromes, or neurologic conditions. 	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Psychiatry and Neurology, 2007.  http://www.abpn.org/.      Board certification for Medical Doctors (MDs) is provided by the American Board of Psychiatry and Neurology.    A subspecialty certificate for NDN was approved by the ABMS in 1999.    ACGME Accredited Residency Program Requirements:  Ongoing early discussions regarding proposal.	\N	\N	\N	metaTaxonomyCode:2084P0005X	\N	\N	\N	\N	\N	f
2084P0015X	2084P0015X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Psychosomatic Medicine	Psychosomatic Medicine is subspecialty in the diagnosis and treatment of psychiatric disorders and symptoms in complex medically ill patients. This subspecialty includes treatment of patients with acute or chronic medical, neurological, obstetrical or surgical illness in which psychiatric illness is affecting their medical care and/or quality of life such as HIV infection, organ transplantation, heart disease, renal failure, cancer, stroke, traumatic brain injury, high-risk pregnancy and COPD, among others. Patients also may be those who have a psychiatric disorder that is the direct consequence of a primary medical condition, or a somatoform disorder or psychological factors affecting a general medical condition. Psychiatrists specializing in Psychosomatic Medicine provide consultation-liaison services in general medical hospitals, attend on medical psychiatry inpatient units, and provide collaborative care in primary care and other outpatient settings.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2084P0015X	\N	\N	\N	\N	\N	f
2084P0301X	2084P0301X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Brain Injury Medicine	A Brain Injury Medicine physician specializes in disorders of brain function due to injury and disease.  These disorders encompass a range of medical, physical, neurologic, cognitive, sensory, and behavioral disorders that result in psychosocial, educational, and vocational consequences.	Source: American Board of Physical Medicine and Rehabilitation, 2015 [1/1/2016: new]	\N	\N	\N	metaTaxonomyCode:2084P0301X	\N	\N	\N	\N	\N	f
2084P0800X	2084P0800X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Psychiatry	A Psychiatrist specializes in the prevention, diagnosis, and treatment of mental disorders, emotional disorders, psychotic disorders, mood disorders, anxiety disorders, substance-related disorders, sexual and gender identity disorders and adjustment disorders. Biologic, psychological, and social components of illnesses are explored and understood in treatment of the whole person. Tools used may include diagnostic laboratory tests, prescribed medications, evaluation and treatment of psychological and interpersonal problems with individuals and families, and intervention for coping with stress, crises, and other problems.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084P0800X	\N	\N	\N	\N	\N	f
2084P0802X	2084P0802X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Addiction Psychiatry	Addiction Psychiatry is a subspecialty of psychiatry that focuses on evaluation and treatment of individuals with alcohol, drug, or other substance-related disorders, and of individuals with dual diagnosis of substance-related and other psychiatric disorders.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084P0802X	\N	\N	\N	\N	\N	f
2084P0804X	2084P0804X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Child & Adolescent Psychiatry	Child & Adolescent Psychiatry is a subspecialty of psychiatry with additional skills and training in the diagnosis and treatment of developmental, behavioral, emotional, and mental disorders of childhood and adolescence.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084P0804X	\N	\N	\N	\N	\N	f
2084P0805X	2084P0805X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Geriatric Psychiatry	Geriatric Psychiatry is a subspecialty with psychiatric expertise in prevention, evaluation, diagnosis and treatment of mental and emotional disorders in the elderly, and improvement of psychiatric care for healthy and ill elderly patients.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084P0805X	\N	\N	\N	\N	\N	f
2084P2900X	2084P2900X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Pain Medicine	A neurologist, child neurologists or psychiatrist who provides a high level of care, either as a primary physician or consultant, for patients experiencing problems with acute, chronic or cancer pain in both hospital and ambulatory settings. Patient care needs may also be coordinated with other specialists.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Psychiatry and Neurology, 2007.  http://www.abpn.org/.      Board certification for Medical Doctors (MDs) is provided by the American Board of Psychiatry and Neurology.    A subspecialty certificate was approved by ABMS in 1998.    ACGME Accredited Residency Program Requirements:  None.	\N	\N	\N	metaTaxonomyCode:2084P2900X	\N	\N	\N	\N	\N	f
2084S0010X	2084S0010X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Sports Medicine	A psychiatrist or neurologist who specializes in the diagnosis and treatment of sports related conditions and injuries.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]   Additional Resources: A Certification of Added Qualifications (CAQ) was, but is no longer issued by the American Osteopathic Board of Neurology and Psychiatry.	\N	\N	\N	metaTaxonomyCode:2084S0010X	\N	\N	\N	\N	\N	f
2084S0012X	2084S0012X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Sleep Medicine	A Psychiatrist or Neurologist who practices Sleep Medicine is certified in the subspecialty of sleep medicine and specializes in the clinical assessment, physiologic testing, diagnosis, management and prevention of sleep and circadian rhythm disorders. Sleep specialists treat patients of any age and use multidisciplinary approaches. Disorders managed by sleep specialists include, but are not limited to, sleep related breathing disorders, insomnia, hypersomnias, circadian rhythm sleep disorders, parasomnias and sleep related movement disorders.	Source: American Academy of Sleep Medicine [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:2084S0012X	\N	\N	\N	\N	\N	f
2084V0102X	2084V0102X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Vascular Neurology	Vascular Neurology is a subspecialty in the evaluation, prevention, treatment and recovery from vascular diseases of the nervous system. This subspecialty includes the diagnosis and treatment of vascular events of arterial or venous origin from a large number of causes that affect the brain or spinal cord such as ischemic stroke, intracranial hemorrhage, spinal cord ischemia and spinal cord hemorrhage.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084V0102X	\N	\N	\N	\N	\N	f
