2085N0700X	2085N0700X	Allopathic & Osteopathic Physicians	Radiology	Neuroradiology	A radiologist who diagnoses and treats diseases utilizing imaging procedures as they relate to the brain, spine and spinal cord, head, neck and organs of special sense in adults and children.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Radiology, 2007.  http://www.theabr.org/.   American Osteopathic Board of Radiology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Radiology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Radiology.	\N	\N	\N	metaTaxonomyCode:2085N0700X	\N	\N	\N	\N	\N	f
2085N0904X	2085N0904X	Allopathic & Osteopathic Physicians	Radiology	Nuclear Radiology	A radiologist who is involved in the analysis and imaging of radionuclides and radiolabeled substances in vitro and in vivo for diagnosis and the administration of radionuclides and radiolabeled substances for the treatment of disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Radiology, 2007.  http://www.theabr.org/.   American Osteopathic Board of Radiology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Radiology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Radiology.	\N	\N	\N	metaTaxonomyCode:2085N0904X	\N	\N	\N	\N	\N	f
2085P0229X	2085P0229X	Allopathic & Osteopathic Physicians	Radiology	Pediatric Radiology	A radiologist who is proficient in all forms of diagnostic imaging as it pertains to the treatment of diseases in the newborn, infant, child and adolescent. This specialist has knowledge of both imaging and interventional procedures related to the care and management of diseases of children. A pediatric radiologist must be highly knowledgeable of all organ systems as they relate to growth and development, congenital malformations, diseases peculiar to infants and children and diseases that begin in childhood but cause substantial residual impairment in adulthood.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Radiology, 2007.  http://www.theabr.org/.   American Osteopathic Board of Radiology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Radiology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Radiology.	\N	\N	\N	metaTaxonomyCode:2085P0229X	\N	\N	\N	\N	\N	f
