2255A2300X	2255A2300X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Specialist/Technologist	Athletic Trainer	Athletic trainers are allied health care professionals who work in consultation with or under the direction of physicians, and specialize in the prevention, assessment, treatment and rehabilitation of injuries and illnesses.  Currently, the entry-level employment requirements are a bachelor’s degree with a major in athletic training from an accredited university or college. A majority of athletic trainers hold advanced degrees.  National board certification is generally required as a condition of state licensure and employment. Most states regulate athletic trainers, and they practice within the scope of that license or regulation.  Clinical practice includes emergency care, rehabilitation, reconditioning, therapeutic exercise, wellness programs, exercise physiology, kinesiology, biomechanics, nutrition, psychology and health care administration.	Source: National Athletic Trainers’ Association (www.NATA.org) [1/1/2006: modified definition, modified source]	\N	\N	\N	metaTaxonomyCode:2255A2300X	\N	\N	\N	\N	\N	f
