225800000X	225800000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Recreation Therapist	\N	A recreation therapist uses recreational activities for intervention in some physical, social or emotional behavior to bring about a desired change in that behavior and promote the growth and development of the patient.	Source: Joel A. DeLisa and Bruce M. Gans, Rehabilitation Medicine: Principles and Practice Second Edition, J.B. Lippincott Company, Philadelphia: 1993, p. 7	\N	\N	\N	metaTaxonomyCode:225800000X	\N	\N	\N	\N	\N	f
225A00000X	225A00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Music Therapist	\N	Music therapists use music interventions to assess clients' strengths and needs, develop goals, implement services, and evaluate and document progress for individuals of all ages.  Music therapists facilitate changes in physical, cognitive, emotional, and/or psychosocial health.	Source:  American Music Therapy Association	\N	\N	\N	metaTaxonomyCode:225A00000X	\N	\N	\N	\N	\N	f
225B00000X	225B00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Pulmonary Function Technologist	\N	An individual who is trained and qualified to perform pulmonary diagnostic tests.  In the course of conducting these tests, the Pulmonary Function Technologist is able to setup, calibrate, maintain, and ensure the quality assurance of the pulmonary function testing equipment.  In the laboratory, clinical or patient care setting the technologist instructs patients, elicits cooperation, performs procedures, monitors patient response, and evaluates patient performance.  Tests results are calculated, compared with predicted normal ranges, and evaluated for reliability.  The technologist collects clinical history data and evaluates the clinical implications of the test results.	\N	\N	\N	\N	metaTaxonomyCode:225B00000X	\N	\N	\N	\N	\N	f
225C00000X	225C00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Rehabilitation Counselor	\N	An individual trained and educated in a systematic process of assisting persons with physical, mental, developmental, cognitive, and emotional disabilities to achieve their personal, career, and independent living goals assessment and appraisal, diagnosis and treatment planning, career (vocational) counseling, individual and group counseling interventions for adjustments to the medical and psychosocial impact of disability, case management, program evaluation and research, job analysis and placement counseling, and consultation on rehabilitation resources and technology. Certification generally requires a Master’s degree with specialized courses in rehabilitation processes and technology.	Sources: Commission on Rehabilitation Counselor Certification and Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:225C00000X	\N	\N	\N	\N	\N	f
