225CX0006X	225CX0006X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Rehabilitation Counselor	Orientation and Mobility Training Provider	Orientation and Mobility (O&M) specialists teach children and adults who have visual impairments the specific orientation skills used to find one's way in the environment and the mobility skills needed to travel safely and efficiently at home, school, work, and in the community. Instruction is usually provided one-on-one and can include skills such as how to use a long cane, the operation of low vision devices and electronic travel aids when appropriate, how to orient oneself to new environments, navigate public transportation systems, how to cross streets safely, and traveling by using hearing, remaining vision, and other senses.  In addition, O&M Specialists help children to develop fundamental skills such as fine and gross motor skills, concept development and problem solving skills. Adult clients can also benefit from an O&M specialist evaluating their current use of travel-related skills, discussing their future goals, and helping them select a program of instruction that will allow them to reach their greatest travel potential.	Source:  San Francisco State University Orientation and Mobility Program web site http://online.sfsu.edu/~mobility/ [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:225CX0006X	\N	\N	\N	\N	\N	f
225X00000X	225X00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	\N	An occupational therapist is a person who has graduated from an entry-level occupational therapy program accredited by the Accreditation Council for Occupational Therapy Education (ACOTE) or predecessor organizations, or approved by the World Federation of Occupational Therapists (WFOT), or an equivalent international occupational therapy education program; has successfully completed a period of supervised fieldwork experience required by the occupational therapy program; has passed a nationally recognized entry-level examination for occupational therapists, and fulfills state requirements for licensure, certification, or registration. An occupational therapist provides interventions based on evaluation and which emphasize the therapeutic use of everyday life activities (i.e., occupations) with individuals or groups for the purpose of facilitating participation in roles and situations and in home, school, workplace, community and other settings. Occupational therapy services are provided for the purpose of promoting health and wellness and are provided to those who have or are at risk for developing an illness, injury, disease, disorder, condition, impairment, disability, activity limitation, or participation restriction.  Occupational therapists address the physical, cognitive, psychosocial, sensory, and other aspects of occupational performance in a variety of contexts to support engagement in everyday life activities that affect health, well-being, and quality of life.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: definition changed, added source]	\N	\N	\N	metaTaxonomyCode:225X00000X	\N	\N	\N	\N	\N	f
226300000X	226300000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Kinesiotherapist	\N	A provider trained and educated in the applied science of medically prescribed therapeutic exercise, education and adapted physical activities designed to improve the quality of line and health of adults and children by developing physical fitness, increasing mobility and independence, and improving psychosocial behavior. The kinesiotherapist seeks a coach-player relationship in which he/she helps the patient/client reach the goal of becoming an independent, self-sustaining person. Kinesiotherapists, as compared with physical therapists, put more emphasis on geriatric care, reconditioning and fitness, and psychiatric care. A large percentage of kinesiotherapists practice in Veterans Administration hospitals.	Source: The Kinesiotherapy Association.	\N	\N	\N	metaTaxonomyCode:226300000X	\N	\N	\N	\N	\N	f
