251J00000X	251J00000X	Agencies	Nursing Care	\N	A Nursing Care Agency is an entity that provides skilled nursing care through the services of a Registered Nurse (RN) or a Licensed Practical Nurse (LPN), by employees, contracted individuals, or via a registry, in a variety of settings. The agency may engage in providing private duty nursing and/or staffing services.	Source: National Uniform Claim Committee, 2008 [7/1/2008: modified definition]	\N	\N	\N	metaTaxonomyCode:251J00000X	\N	\N	\N	\N	\N	f
