251S00000X	251S00000X	Agencies	Community/Behavioral Health	\N	A private or public agency usually under local government jurisdiction, responsible for assuring the delivery of community based mental health, mental retardation, substance abuse and/or behavioral health services to individuals with those disabilities. Services may range from companion care, respite, transportation, community integration, crisis intervention and stabilization, supported employment, day support, prevocational services, residential support, therapeutic and supportive consultation, environmental modifications, intensive in-home therapy and day treatment, in addition to traditional mental health and behavioral treatment.	Source:  National Medicaid EDI HIPAA NPI Sub Work Group [1/1/2007: modified definition]	\N	\N	\N	metaTaxonomyCode:251S00000X	\N	\N	\N	\N	\N	f
251T00000X	251T00000X	Agencies	PACE Provider Organization	\N	A PACE provider organization is a not-for-profit private or public entity that is primarily engaged in providing PACE services(unique capitated managed care benefits for the frail elderly which include comprehensive medical and social services).  The following characteristics also apply to a PACE organization.  It must:  have a governing board that includes community representation	be able to provide complete PACE services regardless of frequency or duration of services	\N	\N	\N	metaTaxonomyCode:251T00000X	\N	\N	\N	\N	\N	f
