282J00000X	282J00000X	Hospitals	Religious Nonmedical Health Care Institution	\N	Furnishes only nonmedical nursing items and services to patients who choose to rely solely upon a religious method of healing, and for whom the acceptance of medical services would be inconsistent with their religious beliefs.  Furnishes nonmedical items and services exclusively through nonmedical nursing personnel who are experienced in caring for the physical needs of nonmedical patients.  For example, caring for the physical needs such as assistance with activities of daily living; assistance in moving, positioning, and ambulation; nutritional needs; and comfort and support measures.  Furnishes nonmedical items and services to inpatients on a 24-hour basis.  Does not furnish, on the basis of religious beliefs, through its personnel or otherwise, medical items and services (including any medical screening, examination, diagnosis, prognosis, treatment, or the administration of drugs) for its patients.	Source:  Centers for Medicare & Medicaid Services, http://www.cms.hhs.gov/CertificationandComplianc/19_RNHCIs.asp#TopOfPage [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:282J00000X	\N	\N	\N	\N	\N	f
