291U00000X	291U00000X	Laboratories	Clinical Medical Laboratory	\N	(1) A clinical laboratory is a facility for the biological, microbiological, serological, chemical, immunohematological, hematological, biophysical, cytological, pathological, or other examination of materials derived from the human body for the purpose of providing information for the diagnosis, prevention, or treatment of any disease or impairment of, human beings. These examinations also include procedures to determine, measure, or otherwise describe the presence or absence of various substances or organisms in the body. Facilities only collecting or preparing specimens (or both) or only serving as a mailing service and not performing testing are not considered clinical laboratories. (2) Any facility that examines materials from the human body for purposes of providing information for the diagnosis, prevention, or treatment of any disease or impairment of, or the assessment of, the health of human beings. Typical divisions of a clinical laboratory include hematology, cytology, bacteriology, histology, biochemistry, medical toxicology, and serology.	Source: (1) Code of Federal Regulations #42, Public Health, Section 493.2. (2) ) Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, The Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, Illinois: 1994, p. 186.	\N	\N	\N	metaTaxonomyCode:291U00000X	\N	\N	\N	\N	\N	f
292200000X	292200000X	Laboratories	Dental Laboratory	\N	A commercial laboratory specializing in the construction of dental appliances that conform to a dentist’s specifications including the construction of dentures (complete or partial), orthodontic appliances, bridgework, crowns, and inlays.	Source: Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, The Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, Illinois: 1994, p. 1245.	\N	\N	\N	metaTaxonomyCode:292200000X	\N	\N	\N	\N	\N	f
293D00000X	293D00000X	Laboratories	Physiological Laboratory	\N	A laboratory that operates independently of a hospital and physician’s office to furnish physiological diagnostic services (e.g. EEG’s , EKG’s, scans, etc.). Facilities offering ONLY physiological services are not certified as independent laboratories. If an independent laboratory offers physiological services IN ADDITION to clinical laboratory services, they are surveyed only for compliance with the clinical laboratory regulations because there are no health and safety regulations for physiological services.	Source: Paraphrased from the Medicare Carrier Manual, Section 2070.5.	\N	\N	\N	metaTaxonomyCode:293D00000X	\N	\N	\N	\N	\N	f
302F00000X	302F00000X	Managed Care Organizations	Exclusive Provider Organization	\N	(1) An EPO is a form of PPO, in which patients must visit a caregiver that is specified on its panel of providers (is a participating provider). If a visit to an outside(not participating) provider is made the EPO offers very limited or no coverage for the medical service; (2) While similar to a PPO in that an EPO allows patients to go outside the network for care, if they do so in an EPO, they are required to pay the entire cost of care. An EPO differs from an HMO in that EPO physicians do not receive capitation but instead are reimbursed only for actual services provided; (3) An organization identical to a preferred provider organization except that persons enrolled in the plan are eligible to receive benefits only when they use the services of the contracting providers. No benefits are available when non-contracting providers are used, except in certain emergency situations.	Source: (1) Medical Interface: Managed Care A thru Z- Managed Care Terms published by Medicom International, Bronxville, New York Telephone (914) 337-5023, p. 15; (2) "Glossary of terms used in managed care" Developed by the Managed Care Assembly (MCA) of Medical Group Management Association (MGMA), MGM Journal, September/October 1995, p. 58; (3) Rhea, Ott, and Shafritz, The Facts On File Dictionary of Health Care Management, New York: Facts On File Publications, 1988.	\N	\N	\N	metaTaxonomyCode:302F00000X	\N	\N	\N	\N	\N	f
302R00000X	302R00000X	Managed Care Organizations	Health Maintenance Organization	\N	(1) A form of health insurance in which its members prepay a premium for the HMO’s health services which generally include inpatient and ambulatory care. For the patient, an HMO means reduced out-of-pocket costs (i.e. no deductible), no paperwork (i.e. insurance forms), and only a small copayment for each office visit to cover the paperwork handled by the HMO; (2) A organization of health care personnel and facilities that provides a comprehensive range of health services to an enrolled population for a fixed sum of money paid in advance for a specified period of time. These health services include a wide variety of medical treatments and consults, inpatient and outpatient hospitalization, home health service, ambulance service, and sometimes dental and pharmacy services. The HMO may be organized as a group model, an individual practice association (IPA), a network model or a staff model.	Source: (1) Medical Interface: Managed Care A thru Z- Managed Care Terms published by Medicom International, Bronxville, New York Telephone (914) 337-5023, p. 20; (2) "Glossary of terms used in managed care" Developed by the Managed Care Assembly (MCA) of Medical Group Management Association (MGMA), MGM Journal, September/October 1995, p. 58	\N	\N	\N	metaTaxonomyCode:302R00000X	\N	\N	\N	\N	\N	f
305R00000X	305R00000X	Managed Care Organizations	Preferred Provider Organization	\N	A group of physicians and/or hospitals who contract with an employer to provide services to their employees. In a PPO, the patient may got to the physician of his/her choice, even if that physician does not participate in the PPO, but the patient receives care at a lower benefit level.	Source: "Glossary of terms used in managed care" Developed by the Managed Care Assembly (MCA) of Medical Group Management Association (MGMA), MGM Journal, September/ October 1995, p. 62	\N	\N	\N	metaTaxonomyCode:305R00000X	\N	\N	\N	\N	\N	f
305S00000X	305S00000X	Managed Care Organizations	Point of Service	\N	This product may also be called an open-ended HMO and offers a transition product incorporating features of both HMOs and PPOs. Beneficiaries are enrolled in an HMO but have the option to go outside the networks for an additional cost.	Source: "Glossary of terms used in managed care" Developed by the Managed Care Assembly (MCA) of Medical Group Management Association (MGMA), MGM Journal, September/October 1995, p. 62	\N	\N	\N	metaTaxonomyCode:305S00000X	\N	\N	\N	\N	\N	f
310400000X	310400000X	Nursing & Custodial Care Facilities	Assisted Living Facility	\N	A facility providing supportive services to individuals who can function independently in most areas of activity, but need assistance and/or monitoring to assure safety and well being.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:310400000X	\N	\N	\N	\N	\N	f
3104A0625X	3104A0625X	Nursing & Custodial Care Facilities	Assisted Living Facility	Assisted Living, Mental Illness	A facility providing supportive services to individuals who can function independently in most areas of activity, but need special guidance, assistance and/or monitoring as the result of a psychiatric problem.  This type of facility requires a staff with special training in mental health training and dealing with psychiatric emergencies.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:3104A0625X	\N	\N	\N	\N	\N	f
332BX2000X	332BX2000X	Suppliers	Durable Medical Equipment & Medical Supplies	Oxygen Equipment & Supplies	Definition to come...	\N	\N	\N	\N	metaTaxonomyCode:332BX2000X	\N	\N	\N	\N	\N	f
311500000X	311500000X	Nursing & Custodial Care Facilities	Alzheimer Center (Dementia Center)	\N	A freestanding facility or special care unit of a long term care facility focusing on patient care of individuals diagnosed with dementia or Alzheimer’s Disease or their related diseases. Six elements of the facility/unit set it apart from other (the rest of the) facilities(y):  Admission of residents with dementia (including those with Alzheimer's disease);  Staff who are specially selected, trained, and supervised;  Activities that are specifically designed for the cognitively impaired;  A marketing of a special care unit in brochures;  A high level of family involvement; and  A physical environment designed to keep residents safe and segregated from other populations.	\N	\N	\N	\N	metaTaxonomyCode:311500000X	\N	\N	\N	\N	\N	f
311Z00000X	311Z00000X	Nursing & Custodial Care Facilities	Custodial Care Facility	\N	A facility providing care that serves to assist an individual in the activities of daily living, such as assistance in walking, getting in and out of bed, bathing, dressing, feeding, and using the toilet, preparation of special diets, and supervision of medication that usually can be self-administered. Custodial care essentially is personal care that does not require the continuing attention of trained medical or paramedical personnel.	Source: Paraphrased from Section 3159 A3 of the Medicare Intermediary Manual.	\N	\N	\N	metaTaxonomyCode:311Z00000X	\N	\N	\N	\N	\N	f
311ZA0620X	311ZA0620X	Nursing & Custodial Care Facilities	Custodial Care Facility	Adult Care Home	A custodial care facility providing supportive and personal care services to disabled and/or elderly individuals who cannot function independently in most areas of activity and need assistance and monitoring to enable them to remain in a home like environment.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:311ZA0620X	\N	\N	\N	\N	\N	f
313M00000X	313M00000X	Nursing & Custodial Care Facilities	Nursing Facility/Intermediate Care Facility	\N	An institution (or a distinct part of an institution) which- (1) is primarily engaged in providing to residents- (A) skilled nursing care and related services for residents who require medical or nursing care, (B) rehabilitation services for the rehabilitation of injured, disabled, or sick persons, or, on a regular basis, health-related care and services to individuals who because of their mental or physical condition require care and services (above the level of room and board) which can be made available to them only through institutional facilities, and is not primarily for the care and treatment of mental diseases; (2) has in effect a transfer agreement with one or more hospitals.	Source: Paraphrased from Section 1919 (a) of the Social Security Act.	\N	\N	\N	metaTaxonomyCode:313M00000X	\N	\N	\N	\N	\N	f
314000000X	314000000X	Nursing & Custodial Care Facilities	Skilled Nursing Facility	\N	(1) A skilled nursing facility is a facility or distinct part of an institution whose primary function is to provide medical, continuous nursing, and other health and social services to patients who are not in an acute phase of illness requiring services in a hospital, but who require primary restorative or skilled nursing services on an inpatient basis above the level of intermediate or custodial care in order to reach a degree of body functioning to permit self care in essential daily living. It meets any licensing or certification standards et forth by the jurisdiction where it is located. A skilled nursing facility may be a freestanding facility or part of a hospital that has been certified by Medicare to admit patients requiring subacute care and rehabilitation; (2) Provides non-acute medical and skilled nursing care services, therapy and social services under the supervision of a licensed registered nurse on a 24-hour basis.	Source: (1) "Glossary of terms used in managed care" Developed by the Managed Care Assembly (MCA) of Medical Group Management Association (MGMA), MGM Journal, September/October 1995, p. 64; (2) AHA Guide, 1996 Annual Survey.	\N	\N	\N	metaTaxonomyCode:314000000X	\N	\N	\N	\N	\N	f
3140N1450X	3140N1450X	Nursing & Custodial Care Facilities	Skilled Nursing Facility	Nursing Care, Pediatric	A nursing care facility designed and staffed for the provision of nursing care and appropriate educational and habilitative/rehabilitative services to children with multiple, complex or profound disabilities that can not be cared for in a less restrictive environment.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:3140N1450X	\N	\N	\N	\N	\N	f
315D00000X	315D00000X	Nursing & Custodial Care Facilities	Hospice, Inpatient	\N	A provider organization, or distinct part of the organization, which renders an interdisciplinary program providing palliative care, chiefly medical relief of pain and supporting services, which addresses the emotional, social, financial, and legal needs of terminally ill patients and their families where an institutional care environment is required for the patient.	Source: AHA Guide, American Hospital Association.	\N	\N	\N	metaTaxonomyCode:315D00000X	\N	\N	\N	\N	\N	f
315P00000X	315P00000X	Nursing & Custodial Care Facilities	Intermediate Care Facility, Mentally Retarded	\N	(1) A public institution for care of the mentally retarded or people with related conditions. (2) An institution giving active treatment to mentally retarded or developmentally disabled persons or persons with related conditions. The primary purpose of the institution is to provide health or rehabilitative services to such individuals.	Sources: (1) Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, IL: 1994, p. 403 (2) Paraphrased from Code of Federal Regulations #42, Public Health, Section 440.150(c).	\N	\N	\N	metaTaxonomyCode:315P00000X	\N	\N	\N	\N	\N	f
317400000X	317400000X	Nursing & Custodial Care Facilities	Christian Science Facility	\N	Inactive, use 282J00000X	[7/1/2009: marked inactive]	\N	\N	\N	metaTaxonomyCode:317400000X	\N	\N	\N	\N	\N	f
320600000X	320600000X	Residential Treatment Facilities	Residential Treatment Facility, Mental Retardation and/or Developmental Disabilities	\N	A residential facility that provides habilitation services and other care and treatment to adults or children diagnosed with developmental disabilities and/or mental retardation and are not able to live independently.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320600000X	\N	\N	\N	\N	\N	f
320700000X	320700000X	Residential Treatment Facilities	Residential Treatment Facility, Physical Disabilities	\N	A residential facility that provides habilitation services and other care and treatment to adults or children diagnosed with developmental disabilities and/or mental retardation and are not able to live independently.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320700000X	\N	\N	\N	\N	\N	f
320800000X	320800000X	Residential Treatment Facilities	Community Based Residential Treatment Facility, Mental Illness	\N	A home-like residential facility providing psychiatric treatment and psycho/social rehabilitative services to individuals diagnosed with mental illness.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320800000X	\N	\N	\N	\N	\N	f
320900000X	320900000X	Residential Treatment Facilities	Community Based Residential Treatment, Mental Retardation and/or Developmental Disabilities	\N	A home-like residential facility providing habilitation, support and monitoring services to individuals diagnosed with mental retardation and/or developmental disabilities.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320900000X	\N	\N	\N	\N	\N	f
322D00000X	322D00000X	Residential Treatment Facilities	Residential Treatment Facility, Emotionally Disturbed Children	\N	A provider facility or distinct part of the organization which renders an interdisciplinary program of mental health treatment to individuals under 21 years of age who have persistent dysfunction in major life areas. The dysfunction is of an extent and pervasiveness that requires a protected and highly structured therapeutic environment. These organizations, or distinct part of organizations, exclude those that provide acute psychiatric care, partial hospitalization, group living, therapeutic schooling, primary diagnosis substance abuse disorder treatment, or primary diagnosis mental retardation or developmental disability treatment.	Source: U.S. Department of Defense Regulation 6010.8-R, Chapter 6.	\N	\N	\N	metaTaxonomyCode:322D00000X	\N	\N	\N	\N	\N	f
323P00000X	323P00000X	Residential Treatment Facilities	Psychiatric Residential Treatment Facility	\N	A residential treatment facility (RTF) is a facility or distinct part of a facility that provides to children and adolescents, a total, twenty-four hour, therapeutically planned group living and learning situation where distinct and individualized psychotherapeutic interventions can take place. Residential treatment is a specific level of care to be differentiated from acute, intermediate, and long-term hospital care, when the least restrictive environment is maintained to allow for normalization of the patient’s surroundings. The RTF must be both physically and programmatically distinct if it is a part or subunit of a larger treatment program. An RTF is organized and professionally staffed to provide residential treatment of mental disorders to children and adolescents who have sufficient intellectual potential to respond to active treatment (that is, for whom it can reasonably be assumed that treatment of the mental disorder will result in an improved ability to function outside the RTF) for whom outpatient treatment, partial hospitalization or protected and structured environment is medically or psychologically necessary	Source: Champus Policy manual, Volume II, p. 6010.47M dated 9/12/94. Revision: Definition title revised 7/1/03	\N	\N	\N	metaTaxonomyCode:323P00000X	\N	\N	\N	\N	\N	f
324500000X	324500000X	Residential Treatment Facilities	Substance Abuse Rehabilitation Facility	\N	A facility or distinct part of a facility that provides a 24 hr therapeutically planned living and rehabilitative intervention environment for the treatment of individuals with disorders in the abuse of drugs, alcohol, and other substances.	[7/1/2003: modified title, modified definition]	\N	\N	\N	metaTaxonomyCode:324500000X	\N	\N	\N	\N	\N	f
3245S0500X	3245S0500X	Residential Treatment Facilities	Substance Abuse Rehabilitation Facility	Substance Abuse Treatment, Children	A facility or distinct part of a facility that provides a 24 hr therapeutically planned living and rehabilitative intervention environment for the treatment of children with disorders in the use of drugs, alcohol, and other substances.  Medical and supportive counseling services and education services are included.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:3245S0500X	\N	\N	\N	\N	\N	f
331L00000X	331L00000X	Suppliers	Blood Bank	\N	An institution (organization or distinct part thereof) that performs, or is responsible for the performance of, the collection, processing, storage and/or issuance of human blood and blood components, intended for transfusion. The institution may also collect, process, and/or distribute human tissue, including bone marrow and peripheral blood progenitor cells, intended for transplantation.	Source: American Association of Blood Banks, Standards for Blood Banks and Tranfusion, 17th ed.	\N	\N	\N	metaTaxonomyCode:331L00000X	\N	\N	\N	\N	\N	f
332000000X	332000000X	Suppliers	Military/U.S. Coast Guard Pharmacy	\N	A Department of Defense (DoD) or U.S. Coast Guard entity whose primary function is to store, prepare and dispense pharmaceuticals and other associated items to Uniformed Services beneficiaries.  These pharmacies may be associated with a DoD or U.S. Coast Guard clinic, DoD Hospital or freestanding.  Usually associated with outpatient services.	Source:  TRICARE Management Activity Uniform Business Office User’s Guide [1/1/2005: new; 7/1/2006: modified title, modified definition]	\N	\N	\N	metaTaxonomyCode:332000000X	\N	\N	\N	\N	\N	f
332100000X	332100000X	Suppliers	Department of Veterans Affairs (VA) Pharmacy	\N	Department of Veterans Affairs (VA) Pharmacy means any place under VA jurisdiction where drugs are dispensed and Pharmaceutical Care is provided to enrolled Veterans, by licensed pharmacists. The Pharmacy is reviewed by JCAHO, utilizes the VA hospital’s DEA number, and has a designated NCPDP number. VA facility pharmacies include Inpatient (Institutional), Outpatient, Consolidated Mail Outpatient Pharmacies (CMOPs), Research, Addiction Treatment Centers, Long Term Care and Community Based Outpatient Clinics Pharmacies. The VHA Pharmacy Benefits Management – Strategic Healthcare Group has oversight for professional and practice activities of VA Pharmacies. Each pharmacy is under the direct supervision of a U.S. or U.S. territory licensed pharmacist, and has staffing to meet its designated scope of service.	Source: Pharmacy Benefits Management – Strategic Healthcare Group, Veterans Health Administration, Department of Veterans Affairs  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:332100000X	\N	\N	\N	\N	\N	f
332800000X	332800000X	Suppliers	Indian Health Service/Tribal/Urban Indian Health (I/T/U) Pharmacy	\N	An Indian Health Service/Tribal/Urban Indian Health (I/T/U) Pharmacy means a pharmacy operated by the Indian Health Service, an Indian tribe or tribal organization, or an urban Indian organization, all of which are defined in Section 4 of the Indian Health Care Improvement Act, 25 U.S.C. 1603.	Source: The Medicare Prescription Drug, Improvement and Modernization Act of 2003  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:332800000X	\N	\N	\N	\N	\N	f
332900000X	332900000X	Suppliers	Non-Pharmacy Dispensing Site	\N	A site other than a pharmacy that dispenses medicinal preparations under the supervision of a physician to patients for self-administration. (e.g. physician offices, ER, Urgent Care Centers, Rural Health Facilities, etc.)	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:332900000X	\N	\N	\N	\N	\N	f
332B00000X	332B00000X	Suppliers	Durable Medical Equipment & Medical Supplies	\N	A supplier of medical equipment such as respirators, wheelchairs, home dialysis systems, or monitoring systems, that are prescribed by a physician for a patient’s use in the home and that are usable for an extended period of time.	\N	\N	\N	\N	metaTaxonomyCode:332B00000X	\N	\N	\N	\N	\N	f
